import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-eventos',
  templateUrl: './eventos.component.html',
  styleUrls: ['./eventos.component.css'],
})
export class EventosComponent implements OnInit {

  public eventos: any;

  constructor(private http: return this.httpClient.get('url');) {}

  ngOnInit() {
    this.getEventos();
  }

  public getEventos() {
    this.eventos = [
      {
        Tema: 'Ayrton Senna',
        Local: 'São Paulo',
      },
      {
        Tema: 'Nelson Piquet',
        Local: 'Rio de Janeiro',
      },
      {
        Tema: 'Roberto Moreno',
        Local: 'Brasilia',
      },
    ];
  }
}
